import { imageListClasses } from '@mui/material'
import { getByPlaceholderText } from '@testing-library/react'
import React from 'react'

const SingleBox = ({box, index, zombie, bullets}) => {
  return (
    <div className={box.position === 10? "border" : ""}
    >

        {zombie.position === box.position? (
            <img className='boximage' src={zombie.image} alt="" />
        )
        :
        ""
    }

     {bullets.map((x, i) => ( x.position === box.position?   <div className='bullet'></div> : ""
            ))}
    </div>
  )
}

export default SingleBox
